column8:
昼間は視認性に優れたホワイトパネル。夜間はＥＬバックライトでパネル面が発光！夜間走行時の視認性が飛躍的にアップします。 <br>発光色はグリーン／ブルーに切替可能、明るさ調整の操作が手元のコントローラーで操作できます。<br>梱包内容：メーターパネル、専用インバーター、コントローラー　(メーター本体は含まれません） <br>対応車種：HCR33スカイライン(ターボ車) <br>　車検対応品<br>メーター/メーターパネル<tr><td colspan="2">
